import { App, PluginSettingTab, Setting, Modal, Notice } from "obsidian";
import EccEncryptPlugin from "../main";
import { changeFileExtension } from "../utils/fileHelper";

class ConfirmModal extends Modal {
  constructor(app: App) {
    super(app);
  }

  onOpen() {
    const { contentEl } = this;
    contentEl.createEl("h3", { text: "Visit GitHub Repository?" });
    contentEl.createEl("p", { text: "Do you want to visit the GitHub repository?" });

    new Setting(contentEl)
      .addButton(button => {
        button
          .setButtonText("Cancel")
          .onClick(() => {
            this.close();
          });
      })
      .addButton(button => {
        button
          .setButtonText("Confirm")
          .setCta()
          .onClick(() => {
            window.open('https://github.com/Enthalpiex/Eccirian-Encrypt/tree/0.1.0', '_blank');
            this.close();
          });
      });
  }

  onClose() {
    const { contentEl } = this;
    contentEl.empty();
  }
}

export class EccEncryptSettingTab extends PluginSettingTab {
  plugin: EccEncryptPlugin;

  constructor(app: App, plugin: EccEncryptPlugin) {
    super(app, plugin);
    this.plugin = plugin;
  }

  display(): void {
    const { containerEl } = this;
    containerEl.empty();

    // Add logo container
    const logoContainer = containerEl.createDiv('eccirian-logo-container');
    logoContainer.style.textAlign = 'center';
    logoContainer.style.marginBottom = '2rem';
    logoContainer.style.cursor = 'pointer';
    logoContainer.style.width = '100%';

    // Add logo image
    const logo = logoContainer.createEl('img', {
      attr: {
                src: 'data:image/png;base64,',
        alt: 'Eccirian Logo'
      }
    });
    logo.style.width = '100%';
    logo.style.height = 'auto';
    logo.style.objectFit = 'cover';

    // Add click event
    logoContainer.addEventListener('click', () => {
      new ConfirmModal(this.app).open();
    });

    new Setting(containerEl)
      .setName("Default encryption method | ")
      .setDesc("Choose a method to use to encrypt the note content| ")
      .addDropdown(drop =>
        drop
          .addOption("AES", "AES-256")
          .addOption("ECC", "ECC+AES")
          .setValue(this.plugin.settings.encryptionMethod)
          .onChange(async (value: "AES" | "ECC") => {
            this.plugin.settings.encryptionMethod = value;
            await this.plugin.saveSettings();
          })
      );

    new Setting(containerEl)
      .setName("Default encryption mode | ")
      .setDesc("Choose the default encryption mode | ")
      .addDropdown(drop =>
        drop
          .addOption("temporary", "Temporary (Single use) | ")
          .addOption("permanent", "Permanent (Not implemented) | ")
          .setValue(this.plugin.settings.defaultEncryptionMode)
          .onChange(async (value: "temporary" | "permanent") => {
            this.plugin.settings.defaultEncryptionMode = value;
            await this.plugin.saveSettings();
          })
      );

    new Setting(containerEl)
      .setName("Icon style | ")
      .setDesc("Choose the icon style for the lock page | ")
      .addDropdown(drop =>
        drop
          .addOption("lock", " Lock | ")
          .addOption("shield", " Shield | ")
          .addOption("key", " Key | ")
          .addOption("padlock", " Padlock | ")
          .setValue(this.plugin.settings.iconStyle)
          .onChange(async (value: "lock" | "shield" | "key" | "padlock") => {
            this.plugin.settings.iconStyle = value;
            await this.plugin.saveSettings();
          })
      );

    new Setting(containerEl)
      .setName("Require password confirmation | ")
      .setDesc("When enabled, requires entering password twice when encrypting | ")
      .addToggle(toggle =>
        toggle
          .setValue(this.plugin.settings.requirePasswordConfirmation)
          .onChange(async (value) => {
            this.plugin.settings.requirePasswordConfirmation = value;
            await this.plugin.saveSettings();
          })
      );

    new Setting(containerEl)
      .setName("Show toggle extension button | ")
      .setDesc("Show the button to toggle between .md and .eccirian extensions |  .md  .eccirian ")
      .addToggle(toggle =>
        toggle
          .setValue(this.plugin.settings.showToggleExtensionButton)
          .onChange(async (value) => {
            this.plugin.settings.showToggleExtensionButton = value;
            await this.plugin.saveSettings();
            (this.plugin as any).updateToggleExtensionButton();
          })
      );

    new Setting(containerEl)
      .setName("Show notices | ")
      .setDesc("Show notification messages when encrypting/decrypting files | /")
      .addToggle(toggle =>
        toggle
          .setValue(this.plugin.settings.showNotice)
          .onChange(async (value) => {
            this.plugin.settings.showNotice = value;
            await this.plugin.saveSettings();
          })
      );

    new Setting(containerEl)
      .setName("Show password hint | ")
      .setDesc("Allow adding a hint when encrypting files | ")
      .addToggle(toggle =>
        toggle
          .setValue(this.plugin.settings.showHint)
          .onChange(async (value) => {
            this.plugin.settings.showHint = value;
            await this.plugin.saveSettings();
          })
      );
  }
}
